import React from "react";
import Slider from "react-slick";
import rapperImage from "../../resources/HomeSlider/Rapper-bohemia.jpg";
import djImage from "../../resources/HomeSlider/nucleya-in-action.jpg";
import bboyImage from "../../resources/HomeSlider/bboying girl.jpg";
import beatBoxerImage from "../../resources/HomeSlider/indian-beatboxer.jpg";
import GrafImage from "../../resources/HomeSlider/Grafeti.jpg";

const HomeSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <div style={{ "background-color": "white" }} className="px-5 py-2">
      <Slider {...settings}>
        <div className="container">
          {/* <h1>1 Slide</h1> */}
          {/* <img src={rapperImage}></img>
          <div>MC</div> */}
          <div class="col-lg-12 text-center p-0 d-flex align-items-center">
            <img
              class="img-fluid position-relative mx-auto"
              src={rapperImage}
              alt=""
            />
            <h3 class="w-100 position-absolute text-danger my-auto">MC</h3>
          </div>
        </div>
        <div className="container">
          {/* <h1>2 Slide</h1> */}
          <img src={djImage}></img>
          <div className="">Djing</div>
        </div>
        <div className="container">
          {/* <h1>3 Slide</h1> */}
          <img src={bboyImage}></img>
          <div className="">BBoying</div>
        </div>
        <div className="container">
          {/* <h1>4 Slide</h1> */}
          <img src={beatBoxerImage}></img>
          <div className="">Beat Boxer</div>
        </div>
        <div className="container">
          {/* <h1>5 Slide</h1> */}
          <img src={GrafImage}></img>
          <div className="">Graftie</div>
        </div>
      </Slider>
    </div>
  );
};

export default HomeSlider;
